import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { Box, Drawer, AppBar, Toolbar, Typography, List, ListItem, 
         ListItemIcon, ListItemText, IconButton, useMediaQuery } from '@mui/material';
import { 
  Dashboard as DashboardIcon,
  EventNote as EventNoteIcon,
  Settings as SettingsIcon,
  Description as DescriptionIcon,
  Menu as MenuIcon
} from '@mui/icons-material';

// Import contexts and providers
import { AppProvider } from './context/AppContext';
import { SettingsProvider, useSettings } from './context/SettingsContext';
import { CalendarProvider } from './context/CalendarContext';

// Import components
import LoadingOverlay from './components/LoadingOverlay';
import Notifications from './components/Notifications';

// Import pages
import Dashboard from './pages/Dashboard';
import BookingForms from './pages/BookingForms';
import Appointments from './pages/Appointments';
import Settings from './pages/Settings';

const drawerWidth = 240;

function MainApp({ initialPage }) {
  const [mobileOpen, setMobileOpen] = React.useState(false);
  const navigate = useNavigate();
  const { settings } = useSettings();
  const isMobile = useMediaQuery((theme) => theme.breakpoints.down('sm'));

  // Create theme based on settings
  const theme = createTheme({
    palette: {
      primary: {
        main: settings?.appearance?.primaryColor || '#007bff',
      },
      secondary: {
        main: settings?.appearance?.secondaryColor || '#6c757d',
      },
    },
    typography: {
      fontFamily: settings?.appearance?.fontFamily || '"Segoe UI", "Helvetica Neue", Arial, sans-serif',
    },
    shape: {
      borderRadius: settings?.appearance?.borderRadius || 4,
    },
  });

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const menuItems = [
    { text: 'Dashboard', icon: <DashboardIcon />, path: '/dashboard' },
    { text: 'Booking Forms', icon: <DescriptionIcon />, path: '/forms' },
    { text: 'Appointments', icon: <EventNoteIcon />, path: '/appointments' },
    { text: 'Settings', icon: <SettingsIcon />, path: '/settings' }
  ];

  const drawer = (
    <div>
      <Toolbar>
        <Typography variant="h6" noWrap component="div">
          WD Appointments
        </Typography>
      </Toolbar>
      <List>
        {menuItems.map((item) => (
          <ListItem 
            button 
            key={item.text}
            onClick={() => {
              navigate(item.path);
              if (isMobile) {
                setMobileOpen(false);
              }
            }}
          >
            <ListItemIcon>
              {item.icon}
            </ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>
    </div>
  );

  React.useEffect(() => {
    // Navigate to initial page based on WordPress admin page
    const pathMap = {
      'dashboard': '/dashboard',
      'forms': '/forms',
      'appointments': '/appointments',
      'settings': '/settings'
    };
    navigate(pathMap[initialPage] || '/dashboard');
  }, [initialPage, navigate]);

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ display: 'flex' }}>
        <AppBar
          position="fixed"
          sx={{
            width: { sm: `calc(100% - ${drawerWidth}px)` },
            ml: { sm: `${drawerWidth}px` },
          }}
        >
          <Toolbar>
            <IconButton
              color="inherit"
              aria-label="open drawer"
              edge="start"
              onClick={handleDrawerToggle}
              sx={{ mr: 2, display: { sm: 'none' } }}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" noWrap component="div">
              WD Appointments
            </Typography>
          </Toolbar>
        </AppBar>

        <Box
          component="nav"
          sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
        >
          <Drawer
            variant="temporary"
            open={mobileOpen}
            onClose={handleDrawerToggle}
            ModalProps={{
              keepMounted: true, // Better open performance on mobile
            }}
            sx={{
              display: { xs: 'block', sm: 'none' },
              '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
            }}
          >
            {drawer}
          </Drawer>
          <Drawer
            variant="permanent"
            sx={{
              display: { xs: 'none', sm: 'block' },
              '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
            }}
            open
          >
            {drawer}
          </Drawer>
        </Box>

        <Box
          component="main"
          sx={{
            flexGrow: 1,
            p: 3,
            width: { sm: `calc(100% - ${drawerWidth}px)` },
            mt: ['56px', '64px']
          }}
        >
          <Routes>
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/forms" element={<BookingForms />} />
            <Route path="/appointments" element={<Appointments />} />
            <Route path="/settings" element={<Settings />} />
          </Routes>
        </Box>

        <Notifications />
        <LoadingOverlay />
      </Box>
    </ThemeProvider>
  );
}

// Wrap the main app with providers
function App({ initialPage }) {
  return (
    <AppProvider>
      <SettingsProvider>
        <CalendarProvider>
          <MainApp initialPage={initialPage} />
        </CalendarProvider>
      </SettingsProvider>
    </AppProvider>
  );
}

export default App;
